import{_ as i,c as r,a2 as p,o as t}from"./chunks/framework.eme8ZeBJ.js";const c=JSON.parse('{"title":"星之海机箱","description":"","frontmatter":{},"headers":[],"relativePath":"case/seaofstars.md","filePath":"case/seaofstars.md","lastUpdated":1738938086000}'),e={name:"case/seaofstars.md"};function s(m,a,l,g,k,h){return t(),r("div",null,a[0]||(a[0]=[p('<h1 id="星之海机箱" tabindex="-1">星之海机箱 <a class="header-anchor" href="#星之海机箱" aria-label="Permalink to &quot;星之海机箱&quot;">​</a></h1><h2 id="小熊座-4-盘位" tabindex="-1">小熊座 - 4 盘位 <a class="header-anchor" href="#小熊座-4-盘位" aria-label="Permalink to &quot;小熊座 - 4 盘位&quot;">​</a></h2><p>小巧精致的 4 盘位机箱，外观比樊隆的好看多了，价格也比较合适。但整体材质做工感觉不如樊隆，优点是可以用 SFX 电源，空间利用率挺不错，支持 12cm 的机箱风扇。参考价：￥299（不含机箱风扇）</p><p><img src="https://img.slarker.me/wiki/tb_image_share_1738937343586.jpg.webp" alt=""></p><p><img src="https://img.slarker.me/wiki/tb_image_share_1738937358158.jpg.webp" alt=""></p><p><img src="https://img.slarker.me/wiki/tb_image_share_1738937386149.jpg.webp" alt=""></p><p><img src="https://img.slarker.me/wiki/tb_image_share_1738937370120.jpg.webp" alt=""></p><h2 id="天蝎座-4-盘位" tabindex="-1">天蝎座 - 4 盘位 <a class="header-anchor" href="#天蝎座-4-盘位" aria-label="Permalink to &quot;天蝎座 - 4 盘位&quot;">​</a></h2><p>外观看起来是像是御夫座的缩小版，设计布局又和乔思伯 N2 差不多，体积控制的不错，4 盘位又多了一个选择！竟然能装一个 19*19 的主板，可以支持两个 PCIE，不过这个尺寸的 MATX 主板比较少。参考价：￥459（不含机箱风扇）</p><p><img src="https://img.slarker.me/wiki/1717174636936_HKlTql.jpg" alt="1717174636936_HKlTql"></p><p><img src="https://img.slarker.me/wiki/1717174636966_yh82zf.jpg" alt="1717174636966_yh82zf"></p><p><img src="https://img.slarker.me/wiki/1717174636977_S1bsQj.jpg" alt="1717174636977_S1bsQj"></p><p><img src="https://img.slarker.me/wiki/1717174636956_N0I4Of.jpg" alt="1717174636956_N0I4Of"></p><p><img src="https://img.slarker.me/wiki/lDDNCL_VJwgd2.png" alt="lDDNCL_VJwgd2"></p><h2 id="御夫座-6-盘位" tabindex="-1">御夫座 - 6 盘位 <a class="header-anchor" href="#御夫座-6-盘位" aria-label="Permalink to &quot;御夫座 - 6 盘位&quot;">​</a></h2><p>颜值不错，6 盘位可以用 MATX 主板和 ATX 电源，缺点也有，就是机箱电源位于主板正上方，导致 CPU 风扇只能用下压式，并且电源风扇和 CPU 风扇对着吹。参考价：￥599（不含机箱风扇）</p><p><img src="https://img.slarker.me/wiki/1715305746864_3jd1Cd.jpg" alt="1715305746864_3jd1Cd"></p><p><img src="https://img.slarker.me/wiki/1715307545443_PIVJlH.png" alt="1715307545443_PIVJlH"></p><p><img src="https://img.slarker.me/wiki/1715307545436_7GrvUp.png" alt="1715307545436_7GrvUp"></p><p><img src="https://img.slarker.me/wiki/1715307545429_TIkOqF.png" alt="1715307545429_TIkOqF"></p><p><img src="https://img.slarker.me/wiki/1715307545422_cwzOiJ.png" alt="1715307545422_cwzOiJ"></p><p><img src="https://img.slarker.me/wiki/1715307545415_uewkQT.png" alt="1715307545415_uewkQT"></p><p><img src="https://img.slarker.me/wiki/1715305746827_EfLV3S.jpg" alt="1715305746827_EfLV3S"></p><p><img src="https://img.slarker.me/wiki/1715305746815_R5QMhN.jpg" alt="1715305746815_R5QMhN"></p><h2 id="射手座-8-盘位" tabindex="-1">射手座 - 8 盘位 <a class="header-anchor" href="#射手座-8-盘位" aria-label="Permalink to &quot;射手座 - 8 盘位&quot;">​</a></h2><p>虽然价位和见方 L 差不多，但个人感觉质感、做工不如见方 L，支持 MATX 主板和 ATX 电源。参考价：￥369（不含机箱风扇）</p><p><img src="https://img.slarker.me/wiki/1715305746808_zSYRVk.jpg" alt="1715305746808_zSYRVk"></p><p><img src="https://img.slarker.me/wiki/1715307350946_CwEArr.png" alt="1715307350946_CwEArr"></p><p><img src="https://img.slarker.me/wiki/1715307311623_pqJRIL.png" alt="1715307311623_pqJRIL"></p><p><img src="https://img.slarker.me/wiki/1715307350895_9oCoHQ.png" alt="1715307350895_9oCoHQ"></p><p><img src="https://img.slarker.me/wiki/1715307350867_riaIjz.png" alt="1715307350867_riaIjz"></p><h2 id="白羊座-8-盘位" tabindex="-1">白羊座 - 8 盘位 <a class="header-anchor" href="#白羊座-8-盘位" aria-label="Permalink to &quot;白羊座 - 8 盘位&quot;">​</a></h2><p>支持 ATX 主板，SFX 电源的 8 盘位机箱，空间利用比较充分，体积算是 8 盘位里比较小的，做工也不错。参考价 ：¥649（不含机箱风扇）</p><p><img src="https://img.slarker.me/wiki/1738850210667-1681530189.webp" alt=""></p><p><img src="https://img.slarker.me/wiki/1738850213135-2085722187.webp" alt=""></p><p><img src="https://img.slarker.me/wiki/1738850216173-440243472.webp" alt=""></p><p><img src="https://img.slarker.me/wiki/1738850230529--884428649.webp" alt=""></p><h2 id="半人马座-8-盘位" tabindex="-1">半人马座 - 8 盘位 <a class="header-anchor" href="#半人马座-8-盘位" aria-label="Permalink to &quot;半人马座 - 8 盘位&quot;">​</a></h2><p>设计和质感拉满的机箱，安装方便，做工用料都不错。支持 ATX 主板和 SFX 电源。参考价格：￥1230（不含机箱风扇）</p><p><img src="https://img.slarker.me/wiki/1715306628443_sYnmrA.png" alt="1715306628443_sYnmrA"></p><p><img src="https://img.slarker.me/wiki/1715306628437_9qYbBX.png" alt="1715306628437_9qYbBX"></p><p><img src="https://img.slarker.me/wiki/1715306628423_h0RL8P.png" alt="1715306628423_h0RL8P"></p><p><img src="https://img.slarker.me/wiki/1715306628430_KKnAJW.png" alt="1715306628430_KKnAJW"></p><p><img src="https://img.slarker.me/wiki/1715306628392_bd4kpJ.png" alt="1715306628392_bd4kpJ"></p><p><img src="https://img.slarker.me/wiki/1715306628413_wo1qut.png" alt="1715306628413_wo1qut"></p><p><img src="https://img.slarker.me/wiki/1715306628405_tpJvq5.png" alt="1715306628405_tpJvq5"></p><p><img src="https://img.slarker.me/wiki/1715306628399_02cHns.png" alt="1715306628399_02cHns"></p>',47)]))}const n=i(e,[["render",s]]);export{c as __pageData,n as default};
